var dompet = (function() {
    "use strict";
    return {
        load: function() {
            setTimeout(function() {
                jQuery("#preloader").remove();
                $("#partial").addClass("show");
            }, 400);
        }
    };
})();

jQuery(window).on("load", function() {
    "use strict";
    dompet.load();
});

